import React from 'react';
import List from './content_json'


class PersonMessage extends React.Component{
  render(){
    return(
      <form class="formcon" action="/action_page.php">
        <div class="contact form-group mt-5 row">
        {List.map((item)=>{
          return(
            <div>
              <label for={item.for} class="col-2 col-form-label font-weight-bold">{item.value}</label>
              <div class="col-5">
                <input type={item.type} class="form-control" id={item.id} name={item.name}/>
              </div>
            </div>
            )
          })}
        </div>
      </form>
    )
  }
}
